import React from "react";


function SearchBar(){

    this.searchBody =[];

    fetch("/search")
    .then(res=> res.json())
    .then(body=>{
        this.searchBody = body;
    });

    return(

        <div className = "searchBar"> {this.searchBody} 
            <script src="https://cdn.jsdelivr.net/npm/fuse.js/dist/fuse.js"></script>

        </div>

    )
}
export default SearchBar;
